import React from 'react'
import './header.css'
import Input from '../Input/Input'

function Header() {
    return (
        <header className="header">
            <h1 className="header__h1">How's the weather today?</h1>
            <Input searchChange={this.onSearchChange} />
        </header>
    )
}

export default Header;
